#
# TABLE STRUCTURE FOR: addresses
#

DROP TABLE IF EXISTS `addresses`;

CREATE TABLE `addresses` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `zipcode` int(10) unsigned DEFAULT NULL COMMENT 'почтовый индекс',
  `country` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'страна/государство',
  `region` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'область/район',
  `city` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'город',
  `street` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'улица',
  `house_num` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'номер дома/строение',
  `flat_num` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'номер квартины/офиса',
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=204 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: cars_clients
#

DROP TABLE IF EXISTS `cars_clients`;

CREATE TABLE `cars_clients` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `client_id` int(10) unsigned DEFAULT NULL COMMENT 'указатель на клиента',
  `brand_id` int(10) unsigned DEFAULT NULL COMMENT 'указатель за запись в таблице cars_brand',
  `model_id` int(10) unsigned DEFAULT NULL COMMENT 'указатель за запись в таблице cars_model',
  `gos_number` varchar(20) COLLATE utf8_unicode_ci NOT NULL COMMENT 'регистрационный номер',
  `vin_num` varchar(20) COLLATE utf8_unicode_ci NOT NULL COMMENT 'номер VIN по ПТС',
  `year_car` year(4) DEFAULT NULL COMMENT 'год выпуска',
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: clients
#

DROP TABLE IF EXISTS `clients`;

CREATE TABLE `clients` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `first_name` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'имя',
  `last_name` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'фамилия',
  `email` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'адрес электронной почты',
  `phone` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'номер телефона',
  `client_status_id` int(10) unsigned DEFAULT NULL COMMENT 'указатель на запись в таблице statuses',
  `cars_id` int(10) unsigned DEFAULT NULL COMMENT 'указатель на запись в таблице cars_clients',
  `address_id` int(10) unsigned DEFAULT NULL COMMENT 'указатель на запись в таблице addresses',
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: orders
#

DROP TABLE IF EXISTS `orders`;

CREATE TABLE `orders` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `description` varchar(250) COLLATE utf8_unicode_ci NOT NULL COMMENT 'описание',
  `client_id` int(10) unsigned DEFAULT NULL COMMENT 'указатель на запись в таблице clients',
  `personal_id` int(10) unsigned DEFAULT NULL COMMENT 'указатель на запись в таблице personals',
  `warehouse_id` int(10) unsigned DEFAULT NULL COMMENT 'указатель на запись в таблице warehouse',
  `quantity_parts` int(10) unsigned DEFAULT NULL COMMENT 'уоличество деталей',
  `sum_sum` int(10) unsigned DEFAULT NULL COMMENT 'стоимость апчастей',
  `order_status_id` int(10) unsigned DEFAULT NULL COMMENT 'статус заказа - выволнен/нет и т.д.',
  `order_type_id` int(10) unsigned DEFAULT NULL COMMENT 'тип услуги',
  `work_list_id` int(10) unsigned DEFAULT NULL COMMENT 'вид работ',
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: personals
#

DROP TABLE IF EXISTS `personals`;

CREATE TABLE `personals` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `first_name` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'имя',
  `last_name` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'фамилия',
  `position` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'должность',
  `phone` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'номер телефона',
  `email` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'адрес электронной почты',
  `address_id` int(10) unsigned DEFAULT NULL COMMENT 'указатель на запись в таблице addresses',
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: work_list
#

DROP TABLE IF EXISTS `work_list`;

CREATE TABLE `work_list` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` text COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'описание работ',
  `price` int(10) unsigned DEFAULT NULL COMMENT 'цена единичной работы',
  `cat_parts_id` int(10) unsigned DEFAULT NULL COMMENT 'деталь из каталога к которой относится работа',
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=201 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



